export class Flight {
  id!: number; // Atributo para el ID del vuelo (número)
  from!: string; // Atributo para el lugar de origen (cadena de texto)
  to!: string; // Atributo para el lugar de destino (cadena de texto)
  date!: Date; // Atributo para la fecha del vuelo (objeto Date)
}
